    {
        path:'/tours',
        display:'Tours'
    }

]

const header = () => {
  return <header className = "header">
    <Container>
        <row>
            <div className="nav__wrapper d-flex align-items-center justify-content-between">

            </div>
        </row>
    </Container>
  </header>
}

export default header
